import React, { useState } from 'react';
import Icons from '@mui/icons-material';
import { useHistory } from 'react-router-dom';

import {
  Box,
  TextField,
  Button,
  CloseIcon,
  Typography,
  Paper,
} from '@mui/material';

export default function Signup() {
  const [config, setConfig] = useState({
    name: '',
    email:'',
    password: ''
    
  });
  let history = useHistory();
   const signup = (e) => {
      e.preventDefault()
      console.log(config);
        history.push("/");
    }
  const paperStyle = {
    padding: 20,
    height: '80vh',
    width: 360,
    
  };
  return (
    <>
      <Box
        className='sec'
        sx={{
          width: '400px',
          position: 'absolute',
          left: '30%',
          top: '7%',
          
        }}
      >
        <Paper elevation={10} style={paperStyle}>
        <div className='signup-form'>
          <Typography variant='h5' sx={{ mt: 2, ml: 17 }} component='h2'>
            Sign up
          </Typography>
          <form className='register-form' id='register-form'>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, name : e.target.value}))} 
                  label='Name'
                  autocomplete='off'
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, email : e.target.value}))} 
                  label='Email'
                  autocomplete='off'
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, profession : e.target.value}))} 
                  label='Profession'
                  autocomplete='off'
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv,password : e.target.value}))} 
                  label='Password'
                  autocomplete='off'
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, confirmpassword : e.target.value}))} 
                  label='Confirm Password'
                  autocomplete='off'
                  variant='outlined'
                />
              </Box>
            </div>
            <div>
              <Button
                variant='contained' onClick={signup}
                sx={{
                  ml: 17,
                  mt: 3,
                }}
              >
                Signup
              </Button>
            </div>
          </form>
        </div>
        </Paper>
      </Box>
    </>
  );
}
